import { useHistory } from 'react-router-dom';

export default function NotFound() {

    let history = useHistory();
   
    
    useEffect(() => {
        setTimeout(() => {
            return history.push({ pathname: '/'})
          }, 5000)
    }, [])

    return (
        
        <div>
            <h1>Pagina n√£o encontrada</h1>
